import { createSlice } from "@reduxjs/toolkit";

const initialState = {
    movie: [],
    movieCount : movie.length
}

export const movieSlice = createSlice({
    name:"movie",
    initialState,
    reducers : {
        test : (state)=>{
            console.log('it works');
        }
    }
})

export const {test} = movieSlice.actions

export default movieSlice.reducer
